import React, { useEffect, useState } from 'react';
import { getParkingLogs, logVehicleEntry, logVehicleExit } from '../services/apiService';

const ParkingLog = () => {
  const [logs, setLogs] = useState([]);
  const [licensePlate, setLicensePlate] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false); // Added loading state for better UX

  // Fetch logs on component mount
  useEffect(() => {
    fetchLogs();
  }, []);

  // Fetch parking logs from backend
  const fetchLogs = async () => {
    try {
      setLoading(true); // Start loading
      const data = await getParkingLogs(); // Fetch logs from API
      console.log('Fetched Logs:', data); // Debug log
      setLogs(data); // Update state with fetched logs
      setError(''); // Clear any previous error
    } catch (err) {
      console.error('Error fetching logs:', err.message);
      setError('Failed to fetch parking logs'); // Display error
    } finally {
      setLoading(false); // Stop loading
    }
  };

  // Handle vehicle entry
  const handleEntry = async () => {
    if (!licensePlate) {
      alert('Please enter a license plate');
      return;
    }

    try {
      setLoading(true); // Start loading
      const response = await logVehicleEntry({ licensePlate });
      alert(`Entry Success! Slot: ${response.slotNumber}`);
      setLicensePlate(''); // Clear the input field
      fetchLogs(); // Refresh logs
    } catch (err) {
      console.error('Error logging entry:', err);
      alert('Error logging vehicle entry');
    } finally {
      setLoading(false); // Stop loading
    }
  };

  // Handle vehicle exit
  const handleExit = async () => {
    if (!licensePlate) {
      alert('Please enter a license plate');
      return;
    }

    try {
      setLoading(true); // Start loading
      const response = await logVehicleExit({ licensePlate });
      alert(`Exit Success! Fee: ${response.fee}`);
      setLicensePlate(''); // Clear the input field
      fetchLogs(); // Refresh logs
    } catch (err) {
      console.error('Error logging exit:', err);
      alert('Error logging vehicle exit');
    } finally {
      setLoading(false); // Stop loading
    }
  };

  // Format dates to Nepal Time
  const formatDate = (dateString) => {
    if (!dateString) return '-';
    return new Date(dateString).toLocaleString('en-US', {
      timeZone: 'Asia/Kathmandu',
      dateStyle: 'medium',
      timeStyle: 'short',
    });
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Parking Logs</h2>

      {/* Input and Buttons */}
      <div style={{ marginBottom: '20px' }}>
        <input
          type="text"
          placeholder="Enter License Plate"
          value={licensePlate}
          onChange={(e) => setLicensePlate(e.target.value)}
          style={{
            padding: '10px',
            marginRight: '10px',
            border: '1px solid #ccc',
            borderRadius: '5px',
          }}
        />
        <button
          onClick={handleEntry}
          style={{
            marginRight: '10px',
            padding: '10px 20px',
            backgroundColor: '#28a745',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
          }}
          disabled={loading} // Disable button during loading
        >
          Entry
        </button>
        <button
          onClick={handleExit}
          style={{
            padding: '10px 20px',
            backgroundColor: '#dc3545',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
          }}
          disabled={loading} // Disable button during loading
        >
          Exit
        </button>
      </div>

      {/* Loading Indicator */}
      {loading && <p>Loading...</p>}

      {/* Error Message */}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {/* Parking Logs Table */}
      <table border="1" style={{ width: '100%', textAlign: 'center', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>License Plate</th>
            <th>Entry Time (Nepal Time)</th>
            <th>Slot Number</th>
            <th>Exit Time</th>
            <th>Fee (NPR)</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index}>
              <td>{log.licensePlate}</td>
              <td>{formatDate(log.entryTime)}</td>
              <td>{log.slotNumber || '-'}</td>
              <td>{formatDate(log.exitTime)}</td>
              <td>{log.fee || '-'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ParkingLog;
